import React from 'react';

const HostDashboard = ({ spaces }) => {
  return (
    <div className="bg-gray-100 p-6 rounded-lg shadow-lg mt-10">
      <h2 className="text-2xl font-bold mb-4 text-gray-700">Dashboard del Anfitrión</h2>
      {spaces.length > 0 ? (
        <table className="table-auto w-full">
          <thead>
            <tr className="bg-gray-200">
              <th className="px-4 py-2">Nombre</th>
              <th className="px-4 py-2">Tipo</th>
              <th className="px-4 py-2">Precio</th>
              <th className="px-4 py-2">Acciones</th>
            </tr>
          </thead>
          <tbody>
            {spaces.map((space) => (
              <tr key={space.id} className="border-t">
                <td className="px-4 py-2">{space.name}</td>
                <td className="px-4 py-2 capitalize">{space.type}</td>
                <td className="px-4 py-2">${space.price}/mes</td>
                <td className="px-4 py-2">
                  <button className="text-blue-500 hover:underline">Editar</button>
                  <button className="text-red-500 hover:underline ml-4">Eliminar</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p className="text-center text-gray-500">No tienes espacios registrados aún.</p>
      )}
    </div>
  );
};

export default HostDashboard;
